      cashStyle = {
        color: 'red'
      };
    }
    return (  
      <div>
          <div className="account">

            <h3> </h3>
            <p><b>Account Name: </b>{this.props.name}</p>
            <p><b>Created At: </b>{this.props.created_at}</p>
            <p><b>Cash: </b><span style={cashStyle}>{this.props.cash}</span></p>
            <p><b>id: </b>{this.props.id}</p>
            <p><b>id: </b>{this.props.id}</p>

          </div>  
        </div>
    );
  }
}

